import md5 from 'md5';

const PUBLIC_API_KEY = 'SUA_CHAVE_PUBLICA_AQUI'; // Substitua pela sua chave pública
const PRIVATE_API_KEY = 'SUA_CHAVE_PRIVADA_AQUI'; // Substitua pela sua chave privada
const BASE_URL = 'https://gateway.marvel.com/v1/public';

export const fetchCharacters = async () => {
  try {
    const timestamp = new Date().getTime();
    const hash = md5(`${timestamp}${PRIVATE_API_KEY}${PUBLIC_API_KEY}`);

    const response = await fetch(`${BASE_URL}/characters?ts=${timestamp}&apikey=${PUBLIC_API_KEY}&hash=${hash}&limit=20`);
    const data = await response.json();
    return data.data.results;
  } catch (error) {
    console.error('Error fetching characters:', error);
    return [];
  }
};
